// components/FeatureSection.js
import React from 'react';

const FeatureSection = () => {
  return (
    <div className="container mx-auto px-4 py-8">
      <div className="flex flex-wrap -mx-2">
        {/* Ensure Security Section */}
        <div className="w-full sm:w-1/2 lg:w-1/3 xl:w-1/4 px-2 mb-4">
          <div className="bg-gray-800 text-white p-6 rounded-md shadow-lg">
            <h2 className="text-2xl font-semibold mb-4">ENSURE SECURITY</h2>
            <p className="text-gray-300 mb-4">
              Ensure the security of your data with our advanced security measures.
            </p>
          </div>
        </div>
        {/* Expert Team Section */}
        <div className="w-full sm:w-1/2 lg:w-1/3 xl:w-1/4 px-2 mb-4">
          <div className="bg-gray-700 text-white p-6 rounded-md shadow-lg">
            <h2 className="text-2xl font-semibold mb-4">EXPERT TEAM</h2>
            <p className="text-gray-300 mb-4">
              Our expert team is dedicated to providing top-notch services and solutions.
            </p>
          </div>
        </div>
        {/* 24/7 Support Section */}
        <div className="w-full sm:w-1/2 lg:w-1/3 xl:w-1/4 px-2 mb-4">
          <div className="bg-black text-white p-6 rounded-md shadow-lg">
            <h2 className="text-2xl font-semibold mb-4">24/7 SUPPORT</h2>
            <p className="text-gray-300 mb-4">
              Get round-the-clock support from our team whenever you need assistance.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default FeatureSection;
